Okay, let's think through the key mechanisms involved in the responder's decision to accept or reject a proposal in this ultimatum game context.

1.  **Fairness Evaluation:** Participants likely evaluate the fairness of the proposed split. This involves comparing the proposed split to some internal reference point of what they consider fair. This reference point could be based on relative contribution (token\_self vs. token\_opp), absolute amount offered (split\_self), or relative share of the total earnings (splitperc\_self).

2.  **Inequity Aversion:** People tend to dislike unequal outcomes, even if the outcome is beneficial to themselves (Fehr & Schmidt, 1999). The strength of this aversion can vary between individuals. I need to consider both disadvantageous inequity (getting less than the opponent) and, to a lesser extent, advantageous inequity (getting more than the opponent).

3.  **Loss Aversion:** People may be more sensitive to losses than to gains (Kahneman & Tversky, 1979). Rejecting a proposal means losing the potential gain, even if it's perceived as unfair.

4.  **Combined Earning Sensitivity:** The participant's evaluation may be sensitive to the total earning, where larger earning may decrease the chance of rejection.

5.  **Noise/Stochasticity:** There's always some level of noise in human decision-making. People don't always act perfectly rationally.

Now, let's consider how these mechanisms interact. Fairness evaluation forms the basis of the utility calculation. Inequity aversion modulates this utility, making unfair offers less attractive. Loss aversion makes rejecting the offer less appealing. Combined earning sensitivity modulates the utility, increasing the chance of acceptance with larger amounts. Noise introduces random variability in the decision.

A mathematical form that could capture these interactions is a utility function that combines these factors.

Here's a proposed model:

*   **Utility Function:** The utility of accepting the offer is a function of:

    *   A baseline utility based on the amount offered to the participant (split\_self).
    *   An inequity aversion term, considering both disadvantageous and advantageous inequity.
    *   A loss aversion parameter influencing the disutility of rejecting the offer.
    * A term for total earnings of the round.
    *   A stochastic error term.

Here's the model specification:

```
<MODEL>
U = beta_amount * split_self - alpha_disadvantage * max(0, split_opp - split_self) - alpha_advantage * max(0, split_self - split_opp) + earning_sensitivity * combined_earning + epsilon
</MODEL>
```

